import HeaderMenu from "../components/HeaderMenu";
import "../App.css"
const HomePage = () => {
    return (
        <div>
            <div class="top">
                <div class="top-text">
                    <p class="p-top"> THE BRAND <br/>
                        <span class="text_under-1">OF LUXERIOUS <span class="text-color-rosa">FASHION</span></span></p>
                </div>
            </div>
        </div>
    )

}

export default HomePage
